    private void drawGraph(int fileNum) {
        GraphView graph = (GraphView) findViewById(R.id.graph1);

        //graph.getSecondScale().addSeries(series);
        //graph.getSecondScale().setMinY(-0.4);
        //graph.getSecondScale().setMaxY(1);


        graph.removeAllSeries();
        graph.getViewport().setMinX(0);
        graph.getViewport().setMaxX(20);
        graph.getViewport().setMinY(-0.4);
        graph.getViewport().setMaxY(1);

        graph.getViewport().setXAxisBoundsManual(true);
        graph.getViewport().setYAxisBoundsManual(true);

        series = new LineGraphSeries<DataPoint>();

        //graph.getSecondScale().addSeries(series);
        //graph.getSecondScale().setMinY(-0.4);
        //graph.getSecondScale().setMaxY(1);



        List<Point> points = null;
        switch(fileNum){
            case 1:
                points=getPoints1();
                break;
            case 2:
                points=getPoints2();
                break;
            case 3:
                points=getPoints3();
                break;
        }

        //List<Point> point = getPoints1(fileNum);
        //List<Point> points = readFile(file);
        //List<Point> points = readFile("f2.txt");
        //List<Point> points = readFile("f1.txt");
        //List<Point> points = readFile("f4.txt");
        //List<Point> points = readFile("f5.txt");

        double minX = Double.MAX_VALUE;
        double maxX = Double.MIN_VALUE;

        double minY = Double.MAX_VALUE;
        double maxY = Double.MIN_VALUE;

        for(Point point : points) {

            double x = point.getX();
            double y = point.getY();

            minX = (x < minX) ? x : minX;
            maxX = (x > maxX) ? x : maxX;

            minY = (y < minY) ? y : minY;
            maxY = (y > maxY) ? y : maxY;

            series.appendData(new DataPoint(x, y), true, points.size());

        }

        graph.getViewport().setMinX(minX);
        graph.getViewport().setMaxX(maxX);

        graph.getViewport().setMinY(minY);
        graph.getViewport().setMaxY(maxY);

        graph.addSeries(series);
    }


